import Layout from '../Components/Layout'

export default function User({user}) {
   console.log("OKKKKK")
    return(
        <Layout>
            <div className="jumbotron">
                <h1 className="display-4">{user.name}</h1>
                <p className="lead">{user.username}</p>
                <hr className="my-4" />
                <h3>Address:</h3>
                <address>{user.address.city} | {user.address.street}</address>
                <h3>Phone:</h3>
                <address>{user.phone}</address>
            </div>
        </Layout>
    )
    
}


export async function getServerSideProps (context){
    console.log("OKKKKKLLLLLL")
    console.log("Context : "+ context.id)
    const res = await fetch(`https://jsonplaceholder.typicode.com/users/${context.id}`)
    const user = await res.json()
    console.log("User "+user)
    return{
        props : user
    } 
}
